import React from "react";
import "./ImageSlider.css";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";

const ImageSlider = ({ slides }) => {
  return (
    <Swiper modules={[EffectFade]} effect="fade">
      {[1, 2, 3].map((i, el) => {
        return (
          <SwiperSlide>
            <img src={slides[0].img}></img>
          </SwiperSlide>
        );
      })}
    </Swiper>
  );
};
export default ImageSlider;
